package com.susanne.Susanne_eindopdrachtVA.utils;

import com.susanne.Susanne_eindopdrachtVA.model.User;
import com.susanne.Susanne_eindopdrachtVA.repository.UserRepository;
import jakarta.annotation.PostConstruct;
import org.springframework.boot.ApplicationArguments;
import org.springframework.boot.ApplicationRunner;
import org.springframework.stereotype.Component;

@Component
public class DataLoader implements ApplicationRunner {

    private final UserRepository userRepository;

    public DataLoader(UserRepository userRepository) {
        this.userRepository = userRepository;
    }

    @Override
    public void run(ApplicationArguments args) {
        loadData();
    }

    @PostConstruct
    public void loadData() {
        User user = userRepository.findById(111L).orElse(null);
        if (user != null) {
            String photoUserPart1 = "data:image/jpeg;base64,";
            String photoUserPart2 = "";
            String photoUser = photoUserPart1 + photoUserPart2;

            user.setPhoto(photoUser.getBytes());
            userRepository.save(user);
        }
    }
}